INSERT INTO `tbl_chart_account_type` (`chart_type_id`, `chart_type_name`, `chart_type_description`, `has_open_balance`, `chart_type_category`, `normal_balance`) VALUES
(1,	'Bank',	'<p>Create one for each cash account, such as:<br /><br /></p>\n                                                <p style=\"padding-left: 30px;\">&bull; Petty cash</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Savings</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Checking</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\"><span style=\"font-size: 12.96px;\">&bull; Money market</p>',	1,	0,	''),
(2,	'Accounts Receivable',	'<p>Tracks money your customers owe you on unpaid incvoices</p>\n                                                <p>&nbsp;</p>\n                                                <p>Most business require only the A/R account that the system automatically creates.</p>',	0,	0,	''),
(3,	'Other Current Asset',	'<p><span>Tracks the value of things that can be converted to cash or used up within one year, such as:</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Prepaid expenses</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Employee cash advances</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Inventory</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Loans from your business</p>',	0,	0,	''),
(4,	'Fixed Asset',	'<p>Tracks the value of significant items* that have a useful life of more than one yeat, such us:<br /><br /></p>\n                                                <p style=\"padding-left: 30px;\">&bull; Buildings</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Land</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Machinery and equipment</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\"><span style=\"font-size: 12.96px;\">&bull; Vehicles</p>\n                                                <p><span style=\"font-size: 12.96px;\"><span style=\"font-size: 12.96px;\">*Consult your tax professional for a minimum amount.</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&nbsp;</p></br>\n                                ',	0,	0,	''),
(5,	'Other Asset',	'<p>Tracks the value of things that are neither Fixed Assets nor Other Current Assets, such as:</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Goodwill</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Long-term notes receivable</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull;Security desposit paid</p>',	0,	0,	''),
(6,	'Accounts Payable',	'<p>Tracks money your&nbsp;owe to vendors for purchase made on credit.</p></br>\n                                                <p>&nbsp;</p></br>\n                                                <p>Most business require only the A/P account that the system automatically creates.</p>',	0,	0,	''),
(7,	'Credit Card',	'<p>Create one for each credit card your business uses.</p>',	0,	0,	''),
(8,	'Other Current Liability',	'<p>Tracks money your business owes and expect to pay within one year, such as:</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Sales tax</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Security deposit/retainers from customers</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Payroll taxes</p>',	0,	0,	''),
(9,	'Long Term Liability',	'<p>Tracks money your business owes and expect to pay back over more than one year, such as:</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Mortgages</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Longtem loans</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Notes payable</p>',	0,	0,	''),
(10,	'Equity',	'<p>Track money invested in, or money taken out of the business by owners or shareholders. Payroll and&nbsp;</p></br>\n                                                <p>reimbursable expenses should not be included</p>',	0,	0,	''),
(11,	'Income',	'<p>Categorizes money earned from normal business operations, such as:<br /><br /></p></br>\n                                                <p style=\"padding-left: 30px;\">&bull; Product sales</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Service sales</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Discount to customers</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&nbsp;</p></br>\n                                                <p style=\"padding-left: 30px;\">&nbsp;</p>',	0,	0,	''),
(12,	'Cost of Goods Sold',	'<p>Tracks the direct costs to produce the items that your business sells, such as:</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Cost of materials</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Cost of labor</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Shipping, freight and delivery</p></br>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\"><span style=\"font-size: 12.96px;\">&bull; Subcontractors</p>',	0,	0,	''),
(13,	'Expense',	'<p>Categorizes money spent in the course of normal business operations, such us:<br /><br /></p>\n                                                <p style=\"padding-left: 30px;\">&bull; Advertising and promotion</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Office supplies</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\">&bull; Insurance</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\"><span style=\"font-size: 12.96px;\">&bull; Legal fees</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\"><span style=\"font-size: 12.96px;\">&bull; Charitable contributions</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"font-size: 12.96px;\"><span style=\"font-size: 12.96px;\">&bull; Rent</p',	0,	0,	''),
(14,	'Other Income',	'<p>Categorizes the money that your business earns that is unrelated to normal business operations, such as:<br /></p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Dividend income</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; interest income</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Insurance reimbursements</p>',	0,	0,	''),
(15,	'Other Expense',	'<p>Categorizes the money that your business spends that is unrelated to normal business operations, such as:<br /></p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Corporation taxes</p>\n                                                <p style=\"padding-left: 30px;\"><span style=\"white-space: pre; background-color: #f5f5f5;\">&bull; Penalties and legal settlements</p>',	0,	0,	'');
