DROP TABLE IF EXISTS `view_product_variant`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `view_product_variant` AS select `product`.`eprod_id` AS `eprod_id`,`variant`.`evariant_id` AS `evariant_id`,group_concat(`op_value`.`option_value` order by `var_name`.`variant_name_order` ASC separator ' • ') AS `variant_name`,`variant`.`evariant_item_id` AS `evariant_item_id`,`variant`.`evariant_item_label` AS `evariant_item_label`,`variant`.`evariant_description` AS `evariant_description` from ((((`tbl_ec_product` `product` join `tbl_ec_variant` `variant` on((`product`.`eprod_id` = `variant`.`evariant_prod_id`))) left join `tbl_variant_name` `var_name` on((`variant`.`evariant_id` = `var_name`.`variant_id`))) left join `tbl_option_name` `op_name` on((`var_name`.`option_name_id` = `op_name`.`option_name_id`))) left join `tbl_option_value` `op_value` on((`var_name`.`option_value_id` = `op_value`.`option_value_id`))) group by `variant`.`evariant_id`;

DROP TABLE IF EXISTS `view_variant_option`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `view_variant_option` AS select `product`.`eprod_id` AS `eprod_id`,`op_name`.`option_name` AS `option_name`,concat(`product`.`eprod_id`,'-',`op_name`.`option_name`) AS `alias`,group_concat(distinct `op_value`.`option_value` order by `var_name`.`variant_name_order` ASC separator ',') AS `variant_value` from ((((`tbl_ec_product` `product` join `tbl_ec_variant` `variant` on((`product`.`eprod_id` = `variant`.`evariant_prod_id`))) join `tbl_variant_name` `var_name` on((`variant`.`evariant_id` = `var_name`.`variant_id`))) join `tbl_option_name` `op_name` on((`var_name`.`option_name_id` = `op_name`.`option_name_id`))) join `tbl_option_value` `op_value` on((`var_name`.`option_value_id` = `op_value`.`option_value_id`))) group by `alias` order by `var_name`.`variant_name_order`;

